  @Input()
  burger = false;

  wideScreen = true;

  showMenu = false;

  innerWidth!: number;

  buttonContactTitle = buttonContact.title;

  linksAndLabels = header;

  @HostListener('window:resize')
  onResize() {
    this.innerWidth = window.innerWidth;

    if (this.innerWidth > 830) {
      this.wideScreen = true;
      this.burger = false;
    } else {
